import React from 'react';
import PropTypes from 'prop-types';
import { Circle, Amount } from './StyledCircleCount'
import { connect } from "react-redux";
import { selectWishlistLength } from '../../../store/wishlist/reducer';


const CircleCount = ({wishitstLength}) => {
  console.log(wishitstLength);
  return (
    <Circle>
      <Amount>{wishitstLength}</Amount>
    </Circle>
  );
}

CircleCount.propTypes = {
  wishitstLength: PropTypes.number.isRequired
}

export default CircleCount;
